import Card from "./Card";

function Tours({tours, ignoreBtnHandler, interestBtnHandler}){
    return(
        <div className="Containers">
            <div>
                <h2 className="Title">Developers Profile</h2>
            </div>

            <div className="cards-window">
            {
                tours.map( (tour) => {
                    return <Card {...tour} ignoreBtnHandler={ignoreBtnHandler} interestBtnHandler={interestBtnHandler}></Card>
                })
            }
            </div>
        </div>
    );
}

export default Tours;
